tables.table_schema:
CREATE TABLE voice_transcripts (
    id SERIAL PRIMARY KEY,
    transcript TEXT,
    sentiment VARCHAR(50)
);

CREATE TABLE support_team_performance (
    id SERIAL PRIMARY KEY,
    support_agent_id INT,
    average_response_time INT,
    satisfaction_rating INT
);

CREATE TABLE voice_transcripts (
    transcript_id INT PRIMARY KEY,
    transcript_text TEXT,
    sentiment_score FLOAT
);

CREATE TABLE support_team (
    team_id INT PRIMARY KEY,
    team_name TEXT,
    team_lead TEXT,
    team_size INT
);

CREATE TABLE SentimentAnalysisData (
    id INT PRIMARY KEY,
    transcript TEXT,
    sentiment_score FLOAT
);

CREATE TABLE SupportTeamMembers (
    id INT PRIMARY KEY,
    name VARCHAR(50),
    role VARCHAR(50),
    team_id INT
);

CREATE TABLE SupportPerformanceMetrics (
    id INT PRIMARY KEY,
    team_id INT,
    performance_rating FLOAT,
    issue_resolved_count INT
);
